import { useContext } from "react";

import axios from "../../utils/axios";
import UserContext from "../../contexts/UserContext";

const After = () => {
  const { checkContext } = useContext(UserContext);
  return (
    <button
      variant="contained"
      color="error"
      onClick={() =>
        axios.post("/auth/logout").then(({ data }) => {
          console.log(data);
          if (data.success) {
            checkContext();
          }
        })
      }
    >
      Sign Out
    </button>
  );
};

export default After;
